import React from 'react'
import { Link } from 'react-router-dom'
import '../css/AppBar.css'

function AppBar () {
  return (
    <div className='appBar'>
      <Link to='/dashboard'>
        <button>
          <h2>About</h2>
        </button>
      </Link>
      <Link to='/nameadder'>
        <button>
          <h2> a dumb react thing </h2>
        </button>
      </Link>
    </div>
  );
}

export default AppBar;
